import { StyleSheet } from "react-native";

const StyleConfidentialityCenter = StyleSheet.create({
    centerConteiner:{
        display:'flex',
        margin:"3%"
    },

    centerButtons:{
        display:"flex",
        width:"100%",
        height: "20%"
    }
});

export default StyleConfidentialityCenter;
